(23, 'International Symposium on Water Sustainability: Challenges, Technologies & Opportunities (IWSS 2021', '2021-09-21', '19:00:00', 'Environment', 'This symposium will explore water sustainability global and local challenges, with the intent of unveiling the technologies adopted and realized opportunities in relation to water sustainability.', 0, 20, 0, 1, 'Murali12', 'AUTAR001'),
