(26, 'National Science Day ', '2021-07-15', '16:45:00', 'Science', 'Department of Mathematics, Amrita School of Arts and Sciences, is celebrating National Science Day - on 3rd April. As part of this celebration the department is organizing an ‘Intercollegiate Quiz Competition’ in Mathematics. Students are invited to participate in this event and win exciting rewards.', 0, 100, 0, 6, 'Krishna_45', 'AUTAR001'),
(27, 'Expert Talk - Techniques of Film Making and Methods of Acting', '2021-08-03', '17:50:00', 'Film making', 'As part of the film studies course, an interactive session with an expert is organized for the film studies specialized students  from the Department of Mass Communication.\r\nActor, Director and writer, Mr. Suveer Bhambhani was the resource person. The session covered Techniques of Film Making and Methods of Acting\r\n', 0, 45, 0, 4, 'Saroja_234', 'AUTAR001'),
