(29, 'IETE Sponsored Workshop on New Generation Big Data Tools & Techniques', '2021-05-22', '10:00:00', 'New Technologies', 'In this era of smart devices, universal internet connectivity and IoT, managing big data efficiently becomes an absolute necessity. Big Data is defined as technologies and initiatives that involve data that is too diverse, fast-changing or massive for conventional technologies, skills and infrastructure to address efficiently.', 150, 200, 0, 2, 'Krishna_45', 'AUTAR001');

